import React, { useState, useEffect } from 'react';

const PET_API = 'http://localhost:8090/bd_petcare/api/pets';
const OWNER_API = 'http://localhost:8090/bd_petcare/api/owners';

function PetForm() {
  const [formData, setFormData] = useState({
    name: '',
    species: '',
    breed: '',
    birthDate: '',
    owner: {
      ownerId: ''
    }
  });

  const [successMessage, setSuccessMessage] = useState('');
  const [ownerLoaded, setOwnerLoaded] = useState(false);

  useEffect(() => {
    // Obtener usuario logueado del localStorage
    const usuarioLogueado = JSON.parse(localStorage.getItem('usuario'));

    if (usuarioLogueado && usuarioLogueado.userId) {
      // Obtener dueño asociado al userId
      fetch(`${OWNER_API}/user/${usuarioLogueado.userId}`)
        .then(res => res.json())
        .then(ownerData => {
          if (ownerData && ownerData.ownerId) {
            setFormData(prev => ({
              ...prev,
              owner: { ownerId: ownerData.ownerId }
            }));
          }
          setOwnerLoaded(true);
        })
        .catch(err => {
          console.error('Error obteniendo dueño por userId:', err);
          setOwnerLoaded(true);
        });
    } else {
      setOwnerLoaded(true);
    }
  }, []);

  const handleChange = (e) => {
    const { name, value } = e.target;

    if (name === 'ownerId') {
      setFormData(prev => ({
        ...prev,
        owner: {
          ...prev.owner,
          ownerId: value
        }
      }));
    } else {
      setFormData(prev => ({
        ...prev,
        [name]: value
      }));
    }
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    fetch(`${PET_API}/save`, {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify(formData)
    })
      .then(res => {
        if (res.ok) {
          setSuccessMessage('Mascota registrada correctamente');
          setFormData({
            name: '',
            species: '',
            breed: '',
            birthDate: '',
            owner: { ownerId: formData.owner.ownerId } // Mantener dueño predeterminado
          });
        } else {
          return res.text().then(text => { throw new Error(text) });
        }
      })
      .catch(err => {
        console.error('Error al registrar mascota:', err);
        setSuccessMessage('Error al registrar mascota');
      });
  };

  if (!ownerLoaded) {
    return <p>Cargando datos...</p>;
  }

  return (
    <div>
      <h2>Registrar Nueva Mascota</h2>
      <form onSubmit={handleSubmit}>
        <div>
          <label>Nombre:</label>
          <input name="name" value={formData.name} onChange={handleChange} required />
        </div>
        <div>
          <label>Especie:</label>
          <input name="species" value={formData.species} onChange={handleChange} required />
        </div>
        <div>
          <label>Raza:</label>
          <input name="breed" value={formData.breed} onChange={handleChange} required />
        </div>
        <div>
          <label>Fecha de nacimiento:</label>
          <input type="date" name="birthDate" value={formData.birthDate} onChange={handleChange} required />
        </div>
        {/* 
          Opcional: si quieres mostrar el dueño asignado pero sin permitir cambiarlo,
          puedes mostrar un campo disabled o un texto. 
          Si quieres permitir cambiarlo, podrías mostrar el select, pero por defecto ya tiene el dueño asignado.
        */}
        <div>
          <label>Dueño:</label>
          <input 
            type="text" 
            value={formData.owner.ownerId} 
            disabled 
            readOnly
          />
        </div>
        <button type="submit">Registrar</button>
      </form>

      {successMessage && <p>{successMessage}</p>}
    </div>
  );
}

export default PetForm;
